import React from "react";
import TotalCard from "./TotalCard/TotalCard";
import GenCards from "./GenCards/GenCards";
import "./OverviewSection.css";
import { useQuery, gql } from "@apollo/client";

const LeetCodeQuery = gql`
{ matchedUser(username: "tush27") {
  username
  submitStats: submitStatsGlobal {
  acSubmissionNum {
  difficulty
  count
  submissions
  }
  }
  }
  }
`;

function OverviewSection() {

  const { data, loading, error } = useQuery(LeetCodeQuery);
  if (loading) return "Loading...";
  if (error) return <pre>{error.message}</pre>



    return (
    <div className="overview">
      <TotalCard />
      <GenCards props={{ title: "Easy", que: "100", imgUrl: "#" }} />
      <GenCards props={{ title: "Medium", que: "200", imgUrl: "#" }} />
      <GenCards props={{ title: "Hard", que: "300", imgUrl: "#" }} />
    </div>
  );
}

export default OverviewSection;
